import React from "react";
import "./App.css";

const Master = ({click, titleButton }) => {
    return <div>
        <input type="range" id="level" name="level" min="0" max="99" step="5" value="0" />

    <input className="button_play" type="button" onClick={click} value={titleButton} />
        </div>
};
export default Master;
